import App from './app';

(() => {
	const app = new App(true);
})();

import Vue from 'vue';
import VueResource from 'vue-resource';
Vue.use(VueResource);
Vue.config.debug = false;

// https://github.com/michael/github
import Github from 'github-api';
import CryptoJS from 'crypto-js';

import Entry from './models/entry';

import jQuery from "jquery";
import toastr from "toastr";

toastr.options = {	
  positionClass: 'toast-bottom-right'
};

class App {

  constructor(test = false) {

    this.github;
		this.user;

		this.filename = 'passwords.txt';
		this.branch = 'master';

    this.vue = new Vue({
      el: '#app',
			data: {
				loading: {
					login: false,
					save: false,
					passwords: false,
					repo_new: false
				},
				username: null,
				password: null,

				decrypted: false,

				repo_type: null,
				repos: [],
				selected_repo: null,

				repo: null,

				repo_new: {
					name: null,
					description: null,
					private: true,
				},				
				data: null,
				secret: null,					

				entries: [],
				entry: null,
			},
			methods: {

				saveEntries: () => {
					this.vue.loading.save = true;
					this.saveEntries(() => {
						this.vue.loading.save = false;
					});
				},

				viewEntry: (index) => {
					this.vue.$set('entry', this.vue.entries[index]);
				},

				addEntry: () => {
					const entry = new Entry({
						name: 'New password' 
					});

					this.vue.entries.push(entry);
					this.vue.$set('entry', entry);
				},

				deleteEntry: () => {
					this.vue.$set('entries', this.vue.entries.filter((entry) => {						
						return entry.uuid() !== this.vue.entry.uuid();
					}));
					toastr.success(this.vue.entry.name + ' has been deleted');
					this.vue.entry = null;
				},

				login: () => {
					this.vue.loading.login = true;
					this.login( this.vue.username, this.vue.password );
					this.getRepos(() => {
						this.vue.loading.login = false;
					});
				},

				selectRepo: () => {
					if (this.vue.repo_type === 'new') {
						this.vue.loading.repo_new = true;

						this.createRepo({
							name: this.vue.repo_new.name,
							description: this.vue.repo_new.description,
							private: this.vue.repo_new.private
						}, () => {
							this.vue.loading.repo_new = false;
						});
					} else {
						this.vue.loading.passwords = true;
						this.selectRepo(this.vue.selected_repo);
						this.getPasswords(() => {
							this.vue.loading.passwords = false;						
						});
					}

				},

				decryptPasswords: () => {
					if (!this.vue.secret) {
						toastr.error("You need to enter your passphrase to decrypt your passwords");
						return;
					}

					if (this.vue.data) {		
						this.decryptPasswords( this.vue.data, this.vue.secret );
					}

					this.vue.decrypted = true;			
				}

			}
    });
  }

	/**
	 * Create a new GitHub repository
	 */
	createRepo( args = {}, callback = () => {} ) {

		const defaults = {
			name: 'passwords',
			description: 'Git password repository',
			private: 'true',			
		};

		const opts = Object.assign( defaults, args );
		opts.private = opts.private === 'false' ? false : true;

		this.user.createRepo( opts, (err, res) => {
			// Error creating the repository
			if (err) {
				console.log(err);
				const response = JSON.parse(err.request.response); 
				toastr.error(response.message);
			} else {			
				// Repository has been created successfuully
				toastr.success('Your new repository has been created');

				// Create the repository object
				this.repo = this.github.getRepo( res.owner.login, res.name );	
				this.vue.$set('repo', this.repo);
			}
			callback();
		});
	}

	/**
	 * Encrypt the passwords
	 */
	encryptPasswords( entries, secret ) {
		entries = this.parseEntries(entries);

		const json = JSON.stringify( entries );
		const base64 = btoa(json);
		const encrypted = CryptoJS.AES.encrypt( base64, secret );

		return encrypted.toString();
	}

	/**
	 * Decrypt the password data
	 */	
	decryptPasswords(data, secret) {

		// TODO; Capture failed decryption
		try {
			const base64 = CryptoJS.AES.decrypt( data, secret ).toString(CryptoJS.enc.Utf8);		
			const json = atob( base64 );
			const entries = this.parseEntries(JSON.parse(json));
			this.vue.$set('entries', entries);
		}
		catch (err) {
			toastr.error('Passwords couldn\'t be decrypted. Please ensure that your passphrase is correct.')
		}
	}

	/**
	 * Parse the entries as new instances of Entry
	 */
	parseEntries( entries ) {
		const _entries = [];

		entries.map((entry) => {
			_entries.push( new Entry(entry) );
		});

		return _entries;
	}

	/**
	 * Save the entries to GitHub
	 */
	saveEntries(callback = () => {}) {				
		const content = this.encryptPasswords(this.vue.$data.entries, this.vue.$data.secret);			
		const message = 'Passwords updated';

		console.log(content);

		this.repo.write(this.branch, this.filename, content, message, {}, (err) => {
			if (err) {
				toastr.error('There was a problem saving your passwords to GitHub');
			} else {
				toastr.success('Your passwords have been saved');
			}

			callback();
		});
	}

	/**
	 * Create new github instance
	 * @param string username The user's github username
	 * @param string password The users' github password
	 */
	login(username, password) {		
		this.github = new Github({
			username: username,
			password: password, 
			auth: 'basic'
		});
	}

	/**
	 * Select a repo
	 */
	selectRepo(index) {
		const repo = this.vue.repos[index];

		this.repo = this.github.getRepo( repo.owner.login, repo.name );				
		this.vue.$set('repo', this.repo);
	}

	/**
	 * Get the password data from the file in the repository
	 */
	getPasswords(callback = () => {}) {
		this.repo.read(this.branch, this.filename, (err, data) => {

			if (err) {
				if (err.error === 404) {					
					// No password file exists yet
				} else {					
					// Some other error has happened					
					toastr.success('There was a problem retrieving your password file');
				}

				return;
			}

			this.vue.$set('data', data);

			callback();
		});
	}

	/**
	 * Get the user's repositories
	 */
	getRepos(callback = () => {}) {
		this.user = this.github.getUser();
		this.user.repos({}, (err, repos) => {
			if (err) {
				if (err.error = 401) {
					toastr.error("Could not authenticate. Please check your login details");
				}
			} else {			
				this.repos = repos;
				this.vue.$set('repos', this.repos);
			}
			callback();
		});
	}

}

export default App;

import uuid from 'uuid-v4';

const _uuid = new WeakMap();

class Entry {

  constructor(props = {}) {
    this.name = props.name || null;
    this.url = props.url || null;
    this.username = props.username || null;
    this.email = props.email || null;
    this.password = props.password || null;
    this.description = props.description || null;

    const __uuid = uuid();

    _uuid.set(this, __uuid);
  }

  icon() {
    return this.url ? 'https://www.google.com/s2/favicons?domain=' + encodeURIComponent(this.url) : null;
  }

  uuid() {
    return _uuid.get(this);
  }

}

export default Entry;

/*!
 * @overview  Github.js
 *
 * @copyright (c) 2013 Michael Aufreiter, Development Seed
 *            Github.js is freely distributable.
 *
 * @license   Licensed under BSD-3-Clause-Clear
 *
 *            For all details and documentation:
 *            http://substance.io/michael/github
 */

(function (root, factory) {
   // UMD boilerplate from https://github.com/umdjs/umd/blob/master/returnExportsGlobal.js
   'use strict';

   /* istanbul ignore next */
   if (typeof define === 'function' && define.amd) {
      // AMD. Register as an anonymous module.
      define(['xmlhttprequest', 'js-base64'], function (XMLHttpRequest, b64encode) {
         return (root.Github = factory(XMLHttpRequest.XMLHttpRequest, b64encode.Base64.encode));
      });
   } else if (typeof module === 'object' && module.exports) {
      if (typeof window !== 'undefined') { // jscs:ignore
         module.exports = factory(window.XMLHttpRequest, window.btoa);
      } else { // jscs:ignore
         module.exports = factory(require('xmlhttprequest').XMLHttpRequest, require('js-base64').Base64.encode);
      }
   } else {
      // Browser globals
      var b64encode = function(str) {
         return root.btoa(encodeURIComponent(str).replace(/%([0-9A-F]{2})/g, function(match, p1) {
            return String.fromCharCode('0x' + p1);
         }));
      };

      root.Github = factory(root.XMLHttpRequest, b64encode);
   }
}(this, function (XMLHttpRequest, b64encode) {
   'use strict';

   // Initial Setup
   // -------------

   var Github = function(options) {
      var API_URL = options.apiUrl || 'https://api.github.com';

      // HTTP Request Abstraction
      // =======
      //
      // I'm not proud of this and neither should you be if you were responsible for the XMLHttpRequest spec.

      var _request = Github._request = function _request(method, path, data, cb, raw, sync) {
         function getURL() {
            var url = path.indexOf('//') >= 0 ? path : API_URL + path;

            url += ((/\?/).test(url) ? '&' : '?');

            if (data && typeof data === 'object' && ['GET', 'HEAD', 'DELETE'].indexOf(method) > -1) {
               for(var param in data) {
                  if (data.hasOwnProperty(param))
                    url += '&' + encodeURIComponent(param) + '=' + encodeURIComponent(data[param]);
               }
            }

            return url + (typeof window !== 'undefined' ? '&' + new Date().getTime() : '');
         }

         var xhr = new XMLHttpRequest();

         xhr.open(method, getURL(), !sync);

         if (!sync) {
            xhr.onreadystatechange = function () {
               if (this.readyState === 4) {
                  if (this.status >= 200 && this.status < 300 || this.status === 304) {
                     cb(null, raw ? this.responseText : this.responseText ? JSON.parse(this.responseText) : true, this);
                  } else {
                     cb({
                        path: path, request: this, error: this.status
                     });
                  }
               }
            };
         }

         if (!raw) {
            xhr.dataType = 'json';
            xhr.setRequestHeader('Accept', 'application/vnd.github.v3+json');
         } else {
            xhr.setRequestHeader('Accept', 'application/vnd.github.v3.raw+json');
         }

         xhr.setRequestHeader('Content-Type', 'application/json;charset=UTF-8');

         if ((options.token) || (options.username && options.password)) {
            var authorization = options.token ? 'token ' + options.token :
               'Basic ' + b64encode(options.username + ':' + options.password);

            xhr.setRequestHeader('Authorization', authorization);
         }

         if (data) {
            xhr.send(JSON.stringify(data));
         } else {
            xhr.send();
         }

         if (sync) {
            return xhr.response;
         }
      };

      var _requestAllPages = Github._requestAllPages = function _requestAllPages(path, cb) {
         var results = [];

         (function iterate() {
            _request('GET', path, null, function(err, res, xhr) {
               if (err) {
                  return cb(err);
               }

               results.push.apply(results, res);

               var links = (xhr.getResponseHeader('link') || '').split(/\s*,\s*/g);
               var next = null;

               links.forEach(function(link) {
                  next = /rel="next"/.test(link) ? link : next;
               });

               if (next) {
                  next = (/<(.*)>/.exec(next) || [])[1];
               }

               if (!next) {
                  cb(err, results);
               } else {
                  path = next;
                  iterate();
               }
            });
         })();
      };

      // User API
      // =======

      Github.User = function() {
         this.repos = function(options, cb) {
            if (arguments.length === 1 && typeof arguments[0] === 'function') {
               cb = options;
               options = {};
            }

            options = options || {};

            var url = '/user/repos';
            var params = [];

            params.push('type=' + encodeURIComponent(options.type || 'all'));
            params.push('sort=' + encodeURIComponent(options.sort || 'updated'));
            params.push('per_page=' + encodeURIComponent(options.per_page || '1000')); // jscs:ignore

            if (options.page) {
               params.push('page=' + encodeURIComponent(options.page));
            }

            url += '?' + params.join('&');

            _request('GET', url, null, cb);
         };

         // List user organizations
         // -------

         this.orgs = function(cb) {
            _request('GET', '/user/orgs', null, cb);
         };

         // List authenticated user's gists
         // -------

         this.gists = function(cb) {
            _request('GET', '/gists', null, cb);
         };

         // List authenticated user's unread notifications
         // -------

         this.notifications = function(options, cb) {
            if (arguments.length === 1 && typeof arguments[0] === 'function') {
               cb = options;
               options = {};
            }

            options = options || {};
            var url = '/notifications';
            var params = [];

            if (options.all) {
               params.push('all=true');
            }

            if (options.participating) {
               params.push('participating=true');
            }

            if (options.since) {
               var since = options.since;

               if (since.constructor === Date) {
                  since = since.toISOString();
               }

               params.push('since=' + encodeURIComponent(since));
            }

            if (options.before) {
               var before = options.before;

               if (before.constructor === Date) {
                  before = before.toISOString();
               }

               params.push('before=' + encodeURIComponent(before));
            }

            if (options.page) {
               params.push('page=' + encodeURIComponent(options.page));
            }

            if (params.length > 0) {
               url += '?' + params.join('&');
            }

            _request('GET', url, null, cb);
         };

         // Show user information
         // -------

         this.show = function(username, cb) {
            var command = username ? '/users/' + username : '/user';

            _request('GET', command, null, cb);
         };

         // List user repositories
         // -------

         this.userRepos = function(username, cb) {
            // Github does not always honor the 1000 limit so we want to iterate over the data set.
            _requestAllPages('/users/' + username + '/repos?type=all&per_page=1000&sort=updated', cb);
         };

         // List user starred repositories
         // -------

         this.userStarred = function(username, cb) {
            // Github does not always honor the 1000 limit so we want to iterate over the data set.
            _requestAllPages('/users/' + username + '/starred?type=all&per_page=1000', function(err, res) {
               cb(err, res);
            });
         };

         // List a user's gists
         // -------

         this.userGists = function(username, cb) {
            _request('GET', '/users/' + username + '/gists', null, cb);
         };

         // List organization repositories
         // -------

         this.orgRepos = function(orgname, cb) {
            // Github does not always honor the 1000 limit so we want to iterate over the data set.
            _requestAllPages('/orgs/' + orgname + '/repos?type=all&&page_num=1000&sort=updated&direction=desc', cb);
         };

         // Follow user
         // -------

         this.follow = function(username, cb) {
            _request('PUT', '/user/following/' + username, null, cb);
         };

         // Unfollow user
         // -------

         this.unfollow = function(username, cb) {
            _request('DELETE', '/user/following/' + username, null, cb);
         };

         // Create a repo
         // -------
         this.createRepo = function(options, cb) {
            _request('POST', '/user/repos', options, cb);
         };
      };

      // Repository API
      // =======

      Github.Repository = function(options) {
         var repo = options.name;
         var user = options.user;
         var fullname = options.fullname;

         var that = this;
         var repoPath;

         if (fullname) {
            repoPath = '/repos/' + fullname;
         } else {
            repoPath = '/repos/' + user + '/' + repo;
         }

         var currentTree = {
            branch: null,
            sha: null
         };

         // Delete a repo
         // --------

         this.deleteRepo = function(cb) {
            _request('DELETE', repoPath, options, cb);
         };

         // Uses the cache if branch has not been changed
         // -------

         function updateTree(branch, cb) {
            if (branch === currentTree.branch && currentTree.sha) {
               return cb(null, currentTree.sha);
            }

            that.getRef('heads/' + branch, function(err, sha) {
               currentTree.branch = branch;
               currentTree.sha = sha;
               cb(err, sha);
            });
         }

         // Get a particular reference
         // -------

         this.getRef = function(ref, cb) {
            _request('GET', repoPath + '/git/refs/' + ref, null, function(err, res, xhr) {
               if (err) {
                  return cb(err);
               }

               cb(null, res.object.sha, xhr);
            });
         };

         // Create a new reference
         // --------
         //
         // {
         //   "ref": "refs/heads/my-new-branch-name",
         //   "sha": "827efc6d56897b048c772eb4087f854f46256132"
         // }

         this.createRef = function(options, cb) {
            _request('POST', repoPath + '/git/refs', options, cb);
         };

         // Delete a reference
         // --------
         //
         // Repo.deleteRef('heads/gh-pages')
         // repo.deleteRef('tags/v1.0')

         this.deleteRef = function(ref, cb) {
            _request('DELETE', repoPath + '/git/refs/' + ref, options, function(err, res, xhr) {
               cb(err, res, xhr);
            });
         };

         // Create a repo
         // -------

         this.createRepo = function(options, cb) {
            _request('POST', '/user/repos', options, cb);
         };

         // Delete a repo
         // --------

         this.deleteRepo = function(cb) {
            _request('DELETE', repoPath, options, cb);
         };

         // List all tags of a repository
         // -------

         this.listTags = function(cb) {
            _request('GET', repoPath + '/tags', null, function(err, tags, xhr) {
               if (err) {
                  return cb(err);
               }

               cb(null, tags, xhr);
            });
         };

         // List all pull requests of a respository
         // -------

         this.listPulls = function(options, cb) {
            options = options || {};
            var url = repoPath + '/pulls';
            var params = [];

            if (typeof options === 'string') {
               // Backward compatibility
               params.push('state=' + options);
            } else {
               if (options.state) {
                  params.push('state=' + encodeURIComponent(options.state));
               }

               if (options.head) {
                  params.push('head=' + encodeURIComponent(options.head));
               }

               if (options.base) {
                  params.push('base=' + encodeURIComponent(options.base));
               }

               if (options.sort) {
                  params.push('sort=' + encodeURIComponent(options.sort));
               }

               if (options.direction) {
                  params.push('direction=' + encodeURIComponent(options.direction));
               }

               if (options.page) {
                  params.push('page=' + options.page);
               }

               if (options.per_page) {
                  params.push('per_page=' + options.per_page);
               }
            }

            if (params.length > 0) {
               url += '?' + params.join('&');
            }

            _request('GET', url, null, function(err, pulls, xhr) {
               if (err) return cb(err);
               cb(null, pulls, xhr);
            });
         };

         // Gets details for a specific pull request
         // -------

         this.getPull = function(number, cb) {
            _request('GET', repoPath + '/pulls/' + number, null, function(err, pull, xhr) {
               if (err) return cb(err);
               cb(null, pull, xhr);
            });
         };

         // Retrieve the changes made between base and head
         // -------

         this.compare = function(base, head, cb) {
            _request('GET', repoPath + '/compare/' + base + '...' + head, null, function(err, diff, xhr) {
               if (err) return cb(err);
               cb(null, diff, xhr);
            });
         };

         // List all branches of a repository
         // -------

         this.listBranches = function(cb) {
            _request('GET', repoPath + '/git/refs/heads', null, function(err, heads, xhr) {
               if (err) return cb(err);
               cb(null, heads.map(function(head) {
                  return head.ref.replace(/^refs\/heads\//, '');
               }), xhr);
            });
         };

         // Retrieve the contents of a blob
         // -------

         this.getBlob = function(sha, cb) {
            _request('GET', repoPath + '/git/blobs/' + sha, null, cb, 'raw');
         };

         // For a given file path, get the corresponding sha (blob for files, tree for dirs)
         // -------

         this.getCommit = function(branch, sha, cb) {
            _request('GET', repoPath + '/git/commits/' + sha, null, function(err, commit, xhr) {
               if (err) return cb(err);
               cb(null, commit, xhr);
            });
         };

         // For a given file path, get the corresponding sha (blob for files, tree for dirs)
         // -------

         this.getSha = function(branch, path, cb) {
            if (!path || path === '') return that.getRef('heads/' + branch, cb);
            _request('GET', repoPath + '/contents/' + path + (branch ? '?ref=' + branch : ''),
               null, function(err, pathContent, xhr) {
                  if (err) return cb(err);
                  cb(null, pathContent.sha, xhr);
               });
         };

         // Retrieve the tree a commit points to
         // -------

         this.getTree = function(tree, cb) {
            _request('GET', repoPath + '/git/trees/' + tree, null, function(err, res, xhr) {
               if (err) return cb(err);
               cb(null, res.tree, xhr);
            });
         };

         // Post a new blob object, getting a blob SHA back
         // -------

         this.postBlob = function(content, cb) {
            if (typeof (content) === 'string') {
               content = {
                  content: content,
                  encoding: 'utf-8'
               };
            } else {
               content = {
                  content: b64encode(content),
                  encoding: 'base64'
               };
            }

            _request('POST', repoPath + '/git/blobs', content, function(err, res) {
               if (err) return cb(err);
               cb(null, res.sha);
            });
         };

         // Update an existing tree adding a new blob object getting a tree SHA back
         // -------

         this.updateTree = function(baseTree, path, blob, cb) {
            var data = {
               base_tree: baseTree,
               tree: [
            {
               path: path,
               mode: '100644',
               type: 'blob',
               sha: blob
            }
          ]
            };

            _request('POST', repoPath + '/git/trees', data, function(err, res) {
               if (err) return cb(err);
               cb(null, res.sha);
            });
         };

         // Post a new tree object having a file path pointer replaced
         // with a new blob SHA getting a tree SHA back
         // -------

         this.postTree = function(tree, cb) {
            _request('POST', repoPath + '/git/trees', {
               tree: tree
            }, function(err, res) {
               if (err) return cb(err);
               cb(null, res.sha);
            });
         };

         // Create a new commit object with the current commit SHA as the parent
         // and the new tree SHA, getting a commit SHA back
         // -------

         this.commit = function(parent, tree, message, cb) {
            var user = new Github.User();

            user.show(null, function(err, userData) {
               if (err) return cb(err);
               var data = {
                  message: message,
                  author: {
                     name: options.user,
                     email: userData.email
                  },
                  parents: [
                    parent
                  ],
                  tree: tree
               };

               _request('POST', repoPath + '/git/commits', data, function(err, res) {
                  if (err) return cb(err);
                  currentTree.sha = res.sha; // Update latest commit
                  cb(null, res.sha);
               });
            });
         };

         // Update the reference of your head to point to the new commit SHA
